{
  "ubx_message_extraction": {
    "name": "UBX-NAV-POSLLH",
    "class_id": "0x01",
    "message_id": "0x02",
    "message_type": "periodic_polled",
    "description": "See important comments concerning validity of position given in section Navigation output filters in the integration manual. This message outputs the Geodetic position in the currently selected ellipsoid. The default is the WGS84 Ellipsoid, but can be changed with the message CFG-NAVSPG-USE_USRDAT.",
    "payload_length": {
      "fixed": 28
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "data_type": "U4",
        "name": "iTOW",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
      },
      {
        "byte_offset": 4,
        "data_type": "I4",
        "name": "lon",
        "scale": {
          "multiplier": 1e-7
        },
        "unit": "deg",
        "description": "Longitude"
      },
      {
        "byte_offset": 8,
        "data_type": "I4",
        "name": "lat",
        "scale": {
          "multiplier": 1e-7
        },
        "unit": "deg",
        "description": "Latitude"
      },
      {
        "byte_offset": 12,
        "data_type": "I4",
        "name": "height",
        "unit": "mm",
        "description": "Height above ellipsoid"
      },
      {
        "byte_offset": 16,
        "data_type": "I4",
        "name": "HMSL",
        "unit": "mm",
        "description": "Height above mean sea level"
      },
      {
        "byte_offset": 20,
        "data_type": "U4",
        "name": "hAcc",
        "unit": "mm",
        "description": "Horizontal accuracy estimate"
      },
      {
        "byte_offset": 24,
        "data_type": "U4",
        "name": "vAcc",
        "unit": "mm",
        "description": "Vertical accuracy estimate"
      }
    ]
  }
}
